import React from 'react';
import { Link  } from '@reach/router'

const ArticleCard = ({article}) => {
  return (
    <div>
      <li>
        <h3>
          {article.title}
        </h3>
        <h4>
          by: <Link to = "/authors/{article.author}">{article.author}</Link>
          <br/>
          in: {article.topic}
        </h4>
        <h5>
          published at: {article.created_at}
        </h5>
      </li>
    </div>
  );
};

export default ArticleCard;
